  const posts = [
    {
      id: 'p1',
      title: 'post title',
      description: 'post description',
      image: '',
      creator: 'u1'
    }, {
      id: 'p2',
      title: 'post title2',
      description: 'post description2',
      image: '',
      creator: 'u2'
    }
  ]

  const userId = useParams().userId
  const loadedPosts = posts.filter(post => post.creator === userId)


  return (
  
  <PostList items={posts} />
  
  );
};

export default UserPosts;
